import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./Login";
import Menu from "./components/Menu";
import MatchSearch from "./components/components2/match_search";
import FriendList from "./components/components2/friend_list";
import MyPlayList from "./components/components2/my_playlist";

const Routers = () => {
  return (
    <>
      <BrowserRouter>
        <Routes>
          {/* <Route path=A element={<B />} /> */}

          <Route path="/" element={<Login />} />
          <Route path="/menu" element={<Menu />} />
          <Route path="/match-search" element={<MatchSearch />} />
          <Route path="/friend-list" element={<FriendList />} />
          <Route path="/my-play-list" element={<MyPlayList />} />
        </Routes>
      </BrowserRouter>
    </>
  );
};
export default Routers;
